import React from 'react'

export default function UserNavbar() {
  return (
    <div className='bg-red-600 text-white h-[15vh]'>
      <div>
        <div>
            <h1 className='text-[10vw]'>فرهاد زارع</h1>
            <p className='opacity-60'>به سامانه صندوق وامک خوش آمدید</p>
        </div>
      </div>
    </div>
  )
}
